import React, { useEffect, useState } from "react";
import { listEmployees } from "./scripts/AdminService";
import { useNavigate } from "react-router-dom";
import '../styles/Employees.css';

export default function Employees() {
  const [employees, setEmployees] = useState([]);
  const navigate = useNavigate();

  const [searchStatus, setSearchStatus] = useState("");
  const [searchLeaveType, setSearchLeaveType] = useState("");
  const [filteredLeaves, setFilteredLeaves] = useState([]);
  useEffect(() => {
    listEmployees()
      .then((response) => {
        setEmployees(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  useEffect(() => {
    let filtered = employees;
    if (searchStatus) {
      filtered = filtered.filter(
        (l) => l.leaveStatus.toLowerCase() === searchStatus.toLowerCase()
      );
    }
    if (searchLeaveType) {
      filtered = filtered.filter(
        (l) => l.leaveType.toLowerCase() === searchLeaveType.toLowerCase()
      );
    }
    setFilteredLeaves(filtered);
  }, [searchStatus, searchLeaveType, leaves]);

  const handleAction = async (employeeid) => {
    navigate(`/admindashboard/employee-attendence/${employeeid}`);
  };

  return (
    <div className="employees-container">
      <h2 className="employees-heading">LIST OF EMPLOYEES</h2>

      <div className="leave-filters">
        <select
          value={searchStatus}
          onChange={(e) => setSearchStatus(e.target.value)}
        >
          <option value="">Filter by Status</option>
          <option value="PENDING">Pending</option>
          <option value="ACCEPTED">Accepted</option>
          <option value="REJECTED">Rejected</option>
          <option value="CANCELLED">Cancelled</option>
        </select>

        <select
          value={searchLeaveType}
          onChange={(e) => setSearchLeaveType(e.target.value)}
        >
          <option value="">Filter by Leave Type</option>
          <option value="CASUAL_LEAVE">Casual Leave</option>
          <option value="SICK_LEAVE">Sick Leave</option>
          <option value="OPTIONAL_LEAVE">Optional Leave</option>
          <option value="EARNED_LEAVE">Earned Leave</option>
        </select>
      </div>

      <div className="table-responsive">
        <table className="employees-table">
          <thead>
            <tr>
              <th>Employee Id</th>
              <th>Employee Name</th>
              <th>Email</th>
              <th>Role</th>
              <th>Mobile No</th>
              <th>Date Of Birth</th>
              <th>Date Of Join</th>
              <th>Gender</th>
              <th>Address</th>
              <th>Reporting To Employee</th>
              <th>View Attendence</th>
            </tr>
          </thead>
          <tbody>

            {employees.length === 0 ? (
              <tr>
                <td colSpan={11} style={{ textAlign: 'center' }}>No employees available</td>
              </tr>
            ) : (
              employees.map((employee) => (
                <tr key={employee.employeeId}>
                  <td>{employee.employeeId}</td>
                  <td>{employee.employeeName}</td>
                  <td>{employee.employeeEmail}</td>
                  <td>{employee.employeeRole}</td>
                  <td>{employee.employeeMobileNo}</td>
                  <td>{employee.employeeDOB}</td>
                  <td>{employee.employeeDOJ}</td>
                  <td>{employee.employeeGender}</td>
                  <td>{employee.employeeAddress}</td>
                  <td>{employee.reporterId}</td>
                  <td><button style={{ backgroundColor: "#088220ea", color: "white", border: "none", fontWeight: "bold" }} onClick={() => handleAction(employee.employeeId)} >View Attendence</button></td>
                </tr>
              )))}
          </tbody>
        </table>
      </div>
    </div>
  );
}
